import './signup.css';
import SignInImage from '../../images/jelo.jpg';
import Button from '../Button/Button';
import { NavLink } from 'react-router-dom';
import axios from 'axios'
import { useState } from 'react';

const FormSigIn = () => {
 const  [userData, setUserData] = useState({
     name: '',
     lastName: '',
     email: '',
     password: '',
     confirmPassword: ''
 })
 const submitHandler = async (value) => {
    setUserData({...userData},value)
    console.log('user',userData)
    axios({
        method: 'post',
        url: 'http://localhost:4000/v1/user/register',
        data: {
          firstName: 'Finn',
          lastName: 'Williams'
        }
      });
 }
 const changeHandler = () => {
     
 }
    return (
        <div className='signin_slider'>
            <div className='sigin_slider_head'>
                <h2 className='sigin_slider_heading'>Register Here</h2>
            </div>
            <div className='signin_slider_main'>
                <div className='sigin_slider_main_img'>
                    <img className='signin_slider_image' src={SignInImage} />


                </div>
                <div className='sigin_slider_main_form'>
                    <form>
                        <label>Name</label>
                        <input name='name' placeholder='Enter your Name' onChange={(e)=>submitHandler( e.target.value)} />

                        <label>LastNAme</label>
                        <input name='lastName' placeholder='Enter your LastName' onChange={(e)=>submitHandler(e.target.value)} />

                        <label>Email</label>
                        <input name='email' placeholder='Enter your Email' onChange={(e)=>submitHandler( e.target.value)}/>
                        <label>Password</label>
                        <input name='password' type='password' placeholder='Enter your Password' onChange={(e)=>submitHandler( e.target.value)} />
                        <label>ConfirmPassword</label>
                        <input name='confirmPassword' type='password' placeholder='Confrm your Password' onChange={(e)=>submitHandler(e.target.value)} />
                        <NavLink to='/signin'>
                            <Button name='Register' list='signin_slider_button' />
                        </NavLink>




                    </form>
                </div>
            </div>
        </div>
    )
}

export default FormSigIn;
